import data from "./Data2";
import "./Content.css";
import Item from "./Item";
const Content = () => {
  const properties = data.properties;
  const [value, changevalue] = useState(0);
  const valuechange = () => {
    changevalue(value + 4);
  };
  return (
    <Item
      one={value}
      two={value + 1}
      three={value + 2}
      four={value + 3}
      change={valuechange}
    />
  );
};
export default Content;
